import React, { useState, useRef, useEffect } from 'react';
import './App.css';

const App = () => {
  const [messages, setMessages] = useState([{
    text: "Hello! I'm your AI assistant. How can I help you today?",
    sender: 'bot'
  }]);
  const [input, setInput] = useState('');
  const [loading, setLoading] = useState(false);
  const messagesEndRef = useRef(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const sendMessage = async () => {
    if (!input.trim()) return;

    const userMessage = { text: input, sender: 'user' };
    setMessages(prev => [...prev, userMessage]);
    const currentInput = input;
    setInput('');
    setLoading(true);

    try {
      // Using Groq API with Llama 3.1 70B (powerful and free)
      const response = await fetch('https://api.groq.com/openai/v1/chat/completions', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${process.env.REACT_APP_GROQ_API_KEY || 'gsk_demo_key'}`
        },
        body: JSON.stringify({
          model: 'llama-3.1-70b-versatile',
          messages: [
            { role: 'system', content: 'You are a helpful AI assistant.' },
            { role: 'user', content: currentInput }
          ],
          max_tokens: 1000,
          temperature: 0.7
        })
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      const botResponse = data.choices?.[0]?.message?.content || 'I apologize, but I cannot process that request right now.';

      const botMessage = { 
        text: botResponse, 
        sender: 'bot' 
      };
      setMessages(prev => [...prev, botMessage]);
    } catch (error) {
      console.error('API Error:', error);

      // Fallback to alternative free API
      try {
        const fallbackResponse = await fetch('https://api.cohere.ai/v1/generate', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${process.env.REACT_APP_COHERE_API_KEY || 'COHERE_TRIAL_KEY'}`
          },
          body: JSON.stringify({
            model: 'command-light',
            prompt: currentInput,
            max_tokens: 300,
            temperature: 0.7
          })
        });

        if (fallbackResponse.ok) {
          const fallbackData = await fallbackResponse.json();
          const botMessage = { 
            text: fallbackData.generations?.[0]?.text || 'Hello! How can I help you today?', 
            sender: 'bot' 
          };
          setMessages(prev => [...prev, botMessage]);
        } else {
          throw new Error('Fallback failed');
        }
      } catch (fallbackError) {
        // Final fallback with intelligent responses
        const intelligentResponses = {
          greeting: ['hello', 'hi', 'hey', 'good morning', 'good afternoon', 'good evening'],
          question: ['what', 'how', 'why', 'when', 'where', 'who'],
          help: ['help', 'assist', 'support', 'guide'],
          thanks: ['thank', 'thanks', 'appreciate']
        };

        const lowerInput = currentInput.toLowerCase();
        let response = "I'm here to help! What would you like to know?";

        if (intelligentResponses.greeting.some(word => lowerInput.includes(word))) {
          response = "Hello! I'm your AI assistant. How can I help you today?";
        } else if (intelligentResponses.question.some(word => lowerInput.startsWith(word))) {
          response = "That's a great question! I'd be happy to help you with that. Could you provide more details?";
        } else if (intelligentResponses.help.some(word => lowerInput.includes(word))) {
          response = "I'm here to assist you! Please let me know what you need help with.";
        } else if (intelligentResponses.thanks.some(word => lowerInput.includes(word))) {
          response = "You're welcome! Is there anything else I can help you with?";
        }

        const botMessage = { text: response, sender: 'bot' };
        setMessages(prev => [...prev, botMessage]);
      }
    }
    setLoading(false);
  };

  return (
    <div className="app">
      <div className="chat-container">
        <div className="chat-header">
          <div className="header-content">
            <div className="ai-avatar">ðŸ¤–</div>
            <div className="header-text">
              <h1>AI Assistant</h1>
              <span className="status">Online</span>
            </div>
          </div>
        </div>

        <div className="messages">
          {messages.map((msg, idx) => (
            <div key={idx} className={`message-wrapper ${msg.sender}`}>
              <div className={`message ${msg.sender}`}>
                <div className="message-content">{msg.text}</div>
                <div className="message-time">
                  {new Date().toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})}
                </div>
              </div>
            </div>
          ))}
          {loading && (
            <div className="message-wrapper bot">
              <div className="message bot typing">
                <div className="typing-indicator">
                  <span></span>
                  <span></span>
                  <span></span>
                </div>
              </div>
            </div>
          )}
          <div ref={messagesEndRef} />
        </div>

        <div className="input-area">
          <div className="input-wrapper">
            <input
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyPress={(e) => e.key === 'Enter' && !loading && sendMessage()}
              placeholder="Type your message..."
              disabled={loading}
            />
            <button 
              onClick={sendMessage} 
              disabled={loading || !input.trim()}
              className="send-button"
            >
              <svg width="20" height="20" viewBox="0 0 24 24" fill="currentColor">
                <path d="M2.01 21L23 12 2.01 3 2 10l15 2-15 2z"/>
              </svg>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
